import Login from './pages/Login.js';
import NotFound from './pages/NotFound.js'
import {
    BrowserRouter as Router,
    Route,
    Switch
} from 'react-router-dom';

class App extends React.Component {

    render() {
        return (
            <div className='App'>
                <Home />
            </div>
        );
    }
}

export default App;

